	, UPD_TS TIMESTAMP 
	, UPD_userid CHAR(25) 
	, DT_VALID_FROM DATE
	, DT_VALID_TO DATE
	, PRIMARY KEY(ID, CODE1,CODE2,NOTE,CODE3,DT,INS_TS)
)
;


